import React, { useState, useEffect } from "react";
import Dropdown from "react-bootstrap/Dropdown";
import DropdownButton from "react-bootstrap/DropdownButton";
//import { Nav, NavLink, Bars, NavMenu, NavBtn, NavBtnLink } from "./navElements";
import { useNavigate, Link } from "react-router-dom";
import axios from "axios";
//import "./mynav.css";


const Navbar = () => {
 
  const navigate = useNavigate();

    
   

 

  const logOut = () => {
    // alert("loggin out");
    dispatch(setSignout());
    navigate("/");
  };


  // const navigate = useNavigate();

  return (
    <>
      
      <Nav>
        <NavLink to="/">
        Home
        </NavLink>
        <Bars />
        <NavMenu>
          <NavLink to="/home1" activeStyle>
            <Link
              className="nav-link active"
              aria-current="page"
              to="/search"
            ></Link>
            Search Songs
          </NavLink>

          <NavLink to="/movies" activeStyle>
            MOVIES
          </NavLink>
          <NavLink to="/getalloffers" activeStyle>
            OFFERS
          </NavLink>

         
        </NavMenu>

        {/*btn when not signed-in*/}
        {!signstatus && (
          <NavBtn>
            <NavBtnLink to="/signin">Sign In</NavBtnLink>
          </NavBtn>
        )}
        {/*btn when signed-in*/}
        {signstatus && (
          <NavBtn>
            <DropdownButton id="dropdown-basic-button" title="PROFILE">
              <Dropdown.Item
                onClick={() => {
                  setProfile(true);

                  {
                    role == "ADMIN"
                      ? navigate("/adminhome")
                      : (role == "USER"
                      ? navigate("/userprofile")
                      : navigate("/managerhome"));
                  }
                }}
              >
                My Profile
              </Dropdown.Item>
              {role == "ADMIN" ? (
                <Dropdown.Item
                  onClick={() => {
                    navigate("/adminhome");
                  }}
                >
                  ADMIN PANEL
                </Dropdown.Item>
              ) : role == "USER" ? null : (
                <Dropdown.Item
                  onClick={() => {
                    navigate("/managerhome");
                  }}
                >
                  MANAGER PANEL
                </Dropdown.Item>
              )}
              {role == "USER" ? (
                <Dropdown.Item
                  onClick={() => {
                    navigate("/seemybokings");
                  }}
                >
                  See Bookings
                </Dropdown.Item>
              ) : null}
              <Dropdown.Item onClick={logOut}>Logout</Dropdown.Item>
            </DropdownButton>
          </NavBtn>
        )}
      </Nav>
    </>
  );
};

export default Navbar;
